Profession objectives
All civil servant user researchers should have a profession objective: something that you do outside of the work in your immediate team to help develop user research at DfE, or support our user research community.
This should be written down in your objectives (alongside your work and professional development objective) with your line manager. It should have an outcome: e.g. attending an interest group isn’t enough, but attending and doing a talk about it to your programme, or experimenting in your team with what you’ve learned, could be.
We expect that as you progress in your user research career, you contribute more in your profession objectives: for example, we expect a senior user researcher to be more active in helping to share their experience and develop the profession than a junior user researcher.
If your line manager isn’t a user researcher, and you have a profession manager instead, then you should plan your profession objective with them, and they should attend some of your ABLE conversations (opens in a new window) alongside your line manager.

